import React from 'react';
import cloudLogo from "./cloud.png";
import { Link } from 'react-router-dom';
export default function Navbar() {
  return (
    <nav className="text-white py-4 px-7 shadow-md" style={{
      background: `linear-gradient(
        14deg,
        rgba(2, 0, 36, 0.8) 0%,
        rgba(24, 24, 65, 0.7) 66%,
        rgb(20, 76, 99) 100%
      ),
      radial-gradient(
        circle,
        rgba(2, 0, 36, 0.5) 0%,
        rgba(32, 15, 53, 0.2) 65%,
        rgba(14, 29, 28, 0.9) 100%
      )`
    }}>
      <div className="container mx-auto flex justify-between items-center">
        <img src={cloudLogo} alt="CloudNotes Logo" className="h-8 w-8" />
        {/* Website Name */}
        <h1 className="text-xl font-bold">CloudNotes</h1>

        {/* Navigation Links */}
        <div className="space-x-4">
        <Link to='/login'>
            <button className="text-white px-4 py-2 rounded-md font-medium transition"
              style={{
                background: `linear-gradient(
                  14deg,
                  rgba(2, 0, 36, 0.8) 0%,
                  rgba(24, 24, 65, 0.7) 66%,
                  rgb(20, 76, 99) 100%
                ),
                radial-gradient(
                  circle,
                  rgba(2, 0, 36, 0.5) 0%,
                  rgba(32, 15, 53, 0.2) 65%,
                  rgba(14, 29, 28, 0.9) 100%
                )`
              }}
            >
              Login
            </button>
          </Link>
          <Link to='/signup'>
            <button className="text-white px-4 py-2 rounded-md font-medium transition"
              style={{
                background: `linear-gradient(
                  14deg,
                  rgba(2, 0, 36, 0.8) 0%,
                  rgba(24, 24, 65, 0.7) 66%,
                  rgb(20, 76, 99) 100%
                ),
                radial-gradient(
                  circle,
                  rgba(2, 0, 36, 0.5) 0%,
                  rgba(32, 15, 53, 0.2) 65%,
                  rgba(14, 29, 28, 0.9) 100%
                )`
              }}
            >
              SignUp
            </button>
          </Link>
         
        </div>
      </div>
    </nav>
  );
}
